    [area] NVARCHAR(50),
    [date_posted] NVARCHAR(50),
    [fridge] NVARCHAR(10),
    [washer] NVARCHAR(10),
    [air_condition] NVARCHAR(10),
    [wifi] NVARCHAR(10)
);
